import React from 'react';
import styled from 'styled-components';
import {ListGroup, Row, Col} from 'react-bootstrap';
import {Layout} from './components/Layout';

const Styles = styled.div`
    .list-group {
        backgroundColor: #A071A9;
    }

    .list-group-item {
        backgroundColor: #A071A9;
    }
`;

export const Contact = () => (
    <Styles>
        <Layout>
            <Col>

            </Col>
            <Col>
                <ListGroup variant="flush" className="list-group">
                    <Row>
                        <ListGroup.Item className="list-group-item">Cras justo odio</ListGroup.Item>
                    </Row>
                    <Row>
                        <ListGroup.Item className="list-group-item">Dapibus ac facilisis in</ListGroup.Item>
                    </Row>
                    <Row>
                        <ListGroup.Item className="list-group-item">Morbi leo risus</ListGroup.Item>
                    </Row>
                </ListGroup>
            </Col>
        </Layout>
    </Styles>
)
